import React, { useState } from 'react';


const App =() =>{
    
    
   const [count , newCount] = useState(0);
    function edit(e){
        newCount(e.target.value)
    }
   const IncNum = () =>{
    newCount(count+1);
   }
   return(
    <>
        <input type='text' value={count} onChange={edit}/>
        <button onClick={IncNum}>Click Me</button>
    </>
   )
}

export default App;
